import React from "react";

const AddTrip = () => {
  return (
    <div className="add-trip">
      <h2>Agregar Viaje</h2>
      <form>
        <label>
          Destino:
          <input type="text" placeholder="Nombre del destino" />
        </label>
        <label>
          Fecha:
          <input type="date" />
        </label>
        <button type="submit">Agregar</button>
      </form>
    </div>
  );
};

export default AddTrip;
